import "../styles/header.css";

function Header() {
    return (
        <div class="jumbotron center">
            <h1>Clicky Game!</h1>
            <br />
            <h4>Click on an image to earn points, but don't click on any more than once!</h4>
        </div>
    );
  }

  export default Header;
